import "./Header.css";
import Menu, {SubMenu, MenuItem} from 'rc-menu';

class Header  extends Component {
  render () {
return(
  <Menu>
<MenuItem>1</MenuItem>
<SubMenu title="2">
<MenuItem>2-1</MenuItem>
</SubMenu>
</Menu>
)
  }
}

export default Header;
